              />
              <Stack.Screen
                name="ColorPicker"
                component={ColorPicker}
                options={{ title: "ColorPicker" }}
              />
            </Stack.Navigator>
          </NavigationContainer>
        </View>
      </View> */}
    </SafeAreaProvider>
  );
}

const styles = StyleSheet.create({
  container: {
    flex: 1,
    justifyContent: "center",
    paddingTop: Constants.statusBarHeight,
    backgroundColor: "#ecf0f1"
  }
});
